rules/references.html.body:
Prefer const
Use const for all references and avoid using var.

ESLint: prefer-const and no-const-assign

This ensures that references are not reassigned, which can lead to bugs and difficult to comprehend code.
Examples
⇣ Incorrect code for this rule:
var snow = 1;
var ice = 2;

⇡ Correct code for this rule:
const snow = 1;
const ice = 2;

Disallow var
Use let instead of var to reassign references.

ESLint: no-var

let is block-scoped rather than function-scoped like var.
Examples
⇣ Incorrect code for this rule:
var snow = 1;
if (true) {
  snow += 1;
}

⇡ Correct code for this rule:
let snow = 1;
if (true) {
  snow += 1;
}

Block Scope
Both let and const are block-scoped. They only exist in the blocks they are defined in.
Examples
{
  let snow = 1;
  const ice = 1;
}
console.log(snow); // ReferenceError: snow is not defined
console.log(ice); // ReferenceError: ice is not defined

rules/objects.html.body:
No new
Use the literal syntax for object creation.

ESLint: no-new-object

Examples
⇣ Incorrect code for this rule:
const snow = new Object();

⇡ Correct code for this rule:
const snow = {};

ES6 Computed Properties
Use computed property names when creating objects with dynamic property names. They allow to define all the properties of an object in one place.
Examples
⇣ Incorrect code for this rule:
function getSnow(snow) {
  return `a key named ${snow}`;
}

const obj = {
  id: 5,
  name: "South Pole",
};
obj[getSnow("enabled")] = true;

⇡ Correct code for this rule:
function getSnow(snow) {
  return `a key named ${snow}`;
}

const obj = {
  id: 5,
  name: "South Pole",
  [getSnow("enabled")]: true,
};

ES6 Object Shorthand
Use object method shorthand.

ESLint: object-shorthand

Examples
⇣ Incorrect code for this rule:
const snow = {
  flake: 1,

  addFlake: function (flake) {
    return snow.flake + flake;
  }
};

⇡ Correct code for this rule:
const snow = {
  flake: 1,

  addFlake(flake) {
    return snow.flake + flake;
  }
};

ES6 Object Concise
Use property value shorthand. It is shorter to write and descriptive.

ESLint: object-shorthand

Examples
⇣ Incorrect code for this rule:
const southPole = "South Pole";

const obj = {
  southPole: southPole,
};

⇡ Correct code for this rule:
const southPole = "South Pole";

const obj = {
  southPole
};

Grouped Shorthand
Group shorthand properties at the beginning of object declarations. It is easier to tell which properties are using the shorthand.
Examples
⇣ Incorrect code for this rule:
const southPole = "South Pole";
const northPole = "North Pole";

const obj = {
  floatingIce: 1,
  northPole,
  penguins: 2,
  southPole
};

⇡ Correct code for this rule:
const southPole = "South Pole";
const northPole = "North Pole";

const obj = {
  northPole,
  southPole,
  floatingIce: 1,
  penguins: 2
};

Quoted Properties
Only quote properties that are invalid identifiers. In general we consider it subjectively easier to read. It improves syntax highlighting and is also more easily optimized by many JS engines.

ESLint: quote-props

Examples
⇣ Incorrect code for this rule:
const obj = {
  "snow": 1,
  "ice": 2
  "frost-wind": 3
};

⇡ Correct code for this rule:
const obj = {
  snow: 1,
  ice: 2,
  "frost-wind": 3
};

Prototype Builtins
Do not call Object.prototype methods directly, such as hasOwnProperty, propertyIsEnumerable, and isPrototypeOf. These methods may be shadowed by properties on the object in question - consider { hasOwnProperty: false } - or, the object may be a null object (Object.create(null)).
Examples
⇣ Incorrect code for this rule:
console.log(object.hasOwnProperty(key));

⇡ Correct code for this rule:
console.log(Object.prototype.hasOwnProperty.call(object, key));

⇢ Recommended code for this rule:
// Cache the lookup once, in module scope.
const hasProp = Object.prototype.hasOwnProperty;

console.log(hasProp.call(object, key));

Using the has npm package:
import has from "has";

console.log(has.call(object, key));

Rest Spread
Prefer the object spread operator over Object.assign to shallow-copy objects. Use the object rest operator to get a new object with certain properties omitted.
Examples
↯ Critical incorrect code for this rule:
const original = {
  snow: 1,
  ice: 2
};
// Both statements mutate "original"!
const copy = Object.assign(original, { frost: 3 });
delete copy.snow; // so does this

⇣ Incorrect code for this rule:
const original = { snow: 1, ice: 2 };
const copy = Object.assign({}, original, { frost: 3 });
console.log(copy); // { snow: 1, ice: 2, frost: 3 }

⇡ Correct code for this rule:
const original = { snow: 1, ice: 2 };
const copy = { ...original, frost: 3 };
console.log(copy); // { snow: 1, ice: 2, frost: 3 }

const { snow, ...noSnow } = copy;
console.log(noSnow); // { ice: 2, frost: 3 }

⇢ Recommended code for this rule:
// Cache the lookup once, in module scope.
const has = Object.prototype.hasOwnProperty;

console.log(has.call(object, key));

Using the has npm package:
import has from "has";

console.log(has.call(object, key));

rules/arrays.html.body:
Literals
Use the literal syntax for array creation.

ESLint: no-array-constructor

Examples
⇣ Incorrect code for this rule:
const snow = new Array();

⇡ Correct code for this rule:
const snow = [];

Push
Use Array#push instead of direct assignment to add items to an array.
Examples
⇣ Incorrect code for this rule:
const winter = [];

winter[snow.length] = "snow";

⇡ Correct code for this rule:
const winter = [];

winter.push("snow");

ES6 Array Spreads
Use array spreads ... to copy arrays.
Examples
⇣ Incorrect code for this rule:
const winter = ["snow", "frost"];
const winterCopy = [];
let idx;

for (idx = 0; idx 
⇡ Correct code for this rule:
const winter = ["snow", "frost"];
const winterCopy = [...winter];

Prefer spreads over from
Use spreads ... instead of Array.from to convert an array-like object to an array.
Examples
⇜ Avoidable code for this rule:
const winter = document.querySelectorAll(".snow");

const nodes = Array.from(winter);

⇢ Recommended code for this rule:
const winter = ["snow", "frost"];
const nodes = [...winter];

Mapping Over Iterables
Use Array.from instead of spread ... for mapping over iterables. This avoids creating an intermediate array.
Examples
⇣ Incorrect code for this rule:
const winter = ["snow", "frost"];
const winterMap = [...winter].map(seasons);

⇡ Correct code for this rule:
const winter = ["snow", "frost"];
const winterMap = Array.from(winter, seasons);

Callback Return
Use return statements in array method callbacks. This excludes functions that consists of a single statement returning an expression without side effects.

ESLint: array-callback-return

Examples
⇣ Incorrect code for this rule:
// No returned value means "winter" becomes undefined after the first iteration.
[[0, 1], [2, 3], [4, 5]].reduce((winter, element, index) => {
  const flatten = winter.concat(element);
  winter[index] = flatten;
});

seasons.filter((season) => {
  const { name, element } = season;
  if (name === "winter") {
    return element === "snow";
  } else {
    return false;
  }
});

⇡ Correct code for this rule:
[1, 2, 3].map((num) => {
  const snow = num + 1;
  return num * snow;
});

[1, 2, 3].map(num => num + 1);

[[0, 1], [2, 3], [4, 5]].reduce((winter, element, index) => {
  const flatten = winter.concat(element);
  winter[index] = flatten;
  return flatten;
});

seasons.filter((season) => {
  const { name, element } = season;
  if (name === "winter") {
    return element === "snow";
  }

  return false;
});

Line Breaks
Use line breaks after open and before close array brackets if an array has multiple lines.
Examples
⇣ Incorrect code for this rule:
const arr = [
  [0, 1], [2, 3], [4, 5]
];

const objectInArray = [{
  id: 1
}, {
  id: 2
}];

const numberInArray = [
  1, 2
];

⇡ Correct code for this rule:
const arr = [[0, 1], [2, 3], [4, 5]];

const objectInArray = [
  {
    id: 1
  },
  {
    id: 2
  }
];

const numberInArray = [
  1,
  2
];

rules/destructuring.html.body:
Objects
Use object destructuring when accessing and using multiple properties of an object. Destructuring avoids the usage of temporary references for those properties.

ESLint: prefer-destructuring

Examples
⇣ Incorrect code for this rule:
function getSeasonElement(season) {
  const name = season.name;
  const element = season.element;

  return `${name} has ${element}`;
}

⇡ Correct code for this rule:
function getSeasonElement(season) {
  const { name, element } = season;
  return `${name} has ${element}`;
}

⇢ Recommended code for this rule:
function getSeasonElement({ name, element }) {
  return `${name} has ${element}`;
}

Arrays
Use array destructuring.

ESLint: prefer-destructuring

Examples
⇣ Incorrect code for this rule:
const winter = ["snow", "frost", "ice"];

const snow = winter[0];
const frost = winter[1];

⇡ Correct code for this rule:
const winter = ["snow", "frost", "ice"];

const [snow, frost] = winter;

Multiple Return Values
Use object destructuring for multiple return values instead of array destructuring. New properties can not be added over time or the order of item can not be changed without breaking call sites.
Examples
⇣ Incorrect code for this rule:
function processElements(elements) {
  // ...
  return [snow, frost, ice];
}

// The caller must adapt to the order of return data.
const [snow, __, ice] = processElements(elements);

⇡ Correct code for this rule:
function processElements(elements) {
  // ...
  return { snow, frost, ice };
}

// The caller selects only the needed data.
const { snow, ice } = processElements(elements);

rules/strings.html.body:
Quotes
Use double quotes "" for strings:

Double quotes reduce the need to escape characters. It eliminates the need to escape apostrophes e.g the string "I'm in love with the winter season" must be changed to 'I\'m in love with the winter season' when using single quotes.
Similarity to other languages. Double quotes are used by many other programming languages like Java, Go and C/C++.
Double quotes are used by the JSON notation.
Parallelism to the natural language. Double quotes are used to identify a passage of quoted text. When using single quotes, the reader may misinterpret it as a contraction. The other meaning of a passage of text surrounded by the ' indicates the colloquial meaning. It makes sense to stay consistent with pre-existing languages, and this may likely ease the learning and interpretation of code.
Double quotes Inline HTML is an anti-pattern.

Some users argument that single quotes can be used for inline HTML without the need to escape characters. We don't agree to this statement because inline HTML is normally a anti-pattern and templates should be used instead.

ESLint: quotes

Examples
⇣ Incorrect code for this rule:
const name = 'South Pole';

// Template literals should only be used for interpolation or newlines.
const name = `South Pole`;

⇡ Correct code for this rule:
const name = "South Pole";

Line Length
Strings that cause the line to go over 100 characters should not be written across multiple lines using string concatenation. Broken strings are painful to work with and make code less searchable.
Examples
⇣ Incorrect code for this rule:
const message = "Cupcake ipsum candy pudding soufflé chocolate. Croissant \
muffin biscuit brownie caramels pudding toffee pie. Tiramisu cookie ice cream \
cake dessert icing donut.";

const message = "Cupcake ipsum candy pudding soufflé chocolate. Croissant" +
 "muffin biscuit brownie caramels pudding toffee pie. Tiramisu cookie ice cream " +
 "cake dessert icing donut.";

⇡ Correct code for this rule:
const message = "Cupcake ipsum candy pudding soufflé chocolate. Croissant muffin biscuit brownie caramels pudding toffee pie. Tiramisu cookie ice cream cake dessert icing donut."

ES6 Template Literals
When programmatically building up strings, use template literals (previoudly called template strings in ES2015 specification) instead of concatenation. Template literals provide a readable, concise syntax with support for embedded expressions. They allow the usage of features like multi-line strings and string interpolation.

ESLint: prefer-template and template-curly-spacing

Examples
⇣ Incorrect code for this rule:
function printSeason(name) {
  return "It's " + name + "season!";
}

function printSeason(name) {
  return ["It's ", name, "season!"].join();
}

function printSeason(name) {
  return `It's ${ name } season!`;
}

⇡ Correct code for this rule:
function printSeason(name) {
  return `It's ${name} season!`;
}

No eval()
Never use eval() on a string, it opens too many vulnerabilities.

ESLint: no-eval

Escaping
Do not unnecessarily escape characters in strings. Backslashes harm readability and should only be used when necessary.

ESLint: no-useless-escape

Examples
⇣ Incorrect code for this rule:
const winter = "\'snowy\' \a\n\d \'sparkling\'";

⇡ Correct code for this rule:
const winter = "\"snowy\" and 'sparkling'";
const winter = `snowy and '${state}'`;

const winter = `I'm in love with the '${seasonName}' season!`;

rules/functions.html.body:
Declaration
Use named function expressions instead of function declarations. Function declarations are hoisted, which means that it is (too) easy to reference the function before it is defined in the file. This harms readability and maintainability.
Functions which definition is too large or complex should be extracted into a own module. Make sure to explicitly name the expression, regardless of whether or not the name is inferred from the containing variable which is often the case in modern browsers or when using compilers such as Babel. This eliminates any assumptions made about the call stack of errors.

ESLint: func-style

Examples
⇣ Incorrect code for this rule:
function winter() {
  // ...
}

const winter = function () {
  // ...
};

⇡ Correct code for this rule:
// Lexical name distinguished from the variable-referenced invocation(s).
const winter = function longUniqueMoreDescriptiveLexicalWinter() {
  // ...
};

IIFE
Wrap immediately invoked function expressions (IIFE) in parentheses. An immediately invoked function expression is a single unit - wrapping both it, and its invocation parens, in parens, cleanly expresses this. Note that in a world with modules everywhere, an IIFE is almost never needed.

ESLint: wrap-iife

Examples
⇡ Correct code for this rule:
(function () {
  console.log("The winter is snowy and sparkling.");
}());

Block Declaration
Never declare a function in a non-function block (if, while, etc). Assign the function to a variable instead. Most browsers will allow it, but they all interpret it differently.
Note: ECMA-262 defines a block as a list of statements. A function declaration is not a statement!

ESLint: no-loop-func

Examples
⇣ Incorrect code for this rule:
if (winter) {
  function snow() {
    console.log("Snowy!");
  }
}

⇡ Correct code for this rule:
let snow;
if (winter) {
  snow = () => {
    console.log("Snowy!");
  };
}

Prevent arguments Shadow
Never name a parameter arguments! This will take precedence over the arguments object that is given to every function scope.
Examples
⇣ Incorrect code for this rule:
function season(name, elements, arguments) {
  // ...
}

⇡ Correct code for this rule:
function season(name, elements, args) {
  // ...
}

ES6 Rest
Never use arguments and use rest syntax ... instead. The rest ... operator is explicit about which arguments to pull. Also rest arguments are a real Array, and not merely Array-like like arguments.

ESLint: prefer-rest-params

Examples
⇣ Incorrect code for this rule:
function concatenateSeasons() {
  const seasons = Array.prototype.slice.call(arguments);
  return seasons.join("");
}

⇡ Correct code for this rule:
function concatenateSeasons(...seasons) {
  return seasons.join("");
}

ES6 Default Parameters
Use default parameter syntax rather than mutating function arguments.
Examples
↯ Critical incorrect code for this rule:
function winter(elements) {
/*
 * This mutates function arguments!
 * If "elements" is falsy it'll also be set to an object which can introduce subtle bugs.
 */
  elements = elements || {};
  // ...
}

⇣ Incorrect code for this rule:
function winter(elements) {
  if (elements === void 0) {
    elements = {};
  }
  // ...
}

⇡ Correct code for this rule:
function winter(elements = {}) {
  // ...
}

Default Side Effects
Avoid side effects with default parameters.
Examples
⇣ Incorrect code for this rule:
let snowflakes = 1;

function count(amount = snowflakes++) {
  console.log(amount);
}
count();  // 1
count();  // 2
count(3); // 3
count();  // 3

Default Parameter Ordering
Always put default parameters last.
Examples
⇣ Incorrect code for this rule:
function winter(elements = {}, name) {
  // ...
}

⇡ Correct code for this rule:
function winter(name, elements = {}) {
  // ...
}

Constructor
Never use the Function constructor to create a new function. Creating a function in this way evaluates a string similarly to eval(), which opens vulnerabilities.

ESLint: no-new-func

Examples
⇣ Incorrect code for this rule:
const add = new Function("snow", "frost", "return snow + frost");

const subtract = Function("snow", "frost", "return snow - frost");

Signature Spacing
Use spacing in a function signature.

ESLint: space-before-function-paren and space-before-blocks

Examples
⇣ Incorrect code for this rule:
const snow = function(){};

const snow = function (){};

const snow = function() {};

⇡ Correct code for this rule:
const snow = function () {};

const snow = function flake() {};

Parameter Mutation
Never mutate parameters. Manipulating objects passed in as parameters can cause unwanted variable side effects in the original caller.

ESLint: no-param-reassign

Examples
⇣ Incorrect code for this rule:
function snow(flake) {
  flake.key = 1;
}

⇡ Correct code for this rule:
function snow(flake) {
  const key = Object.prototype.hasOwnProperty.call(flake, "key") ? flake.key : 1;
}

Parameter Reassign
Never reassign parameters. It can lead to unexpected behavior, especially when accessing the arguments object. It can also cause optimization issues, especially in V8.

ESLint: no-param-reassign

Examples
⇣ Incorrect code for this rule:
function snow(flake) {
  flake = 1;
  // ...
}

function snow(flake) {
  if (!flake) { flake = 1; }
  // ...
}

⇡ Correct code for this rule:
function snow(flake) {
  const flakeCopy = flake || 1;
  // ...
}

function snow(flake = 1) {
  // ...
}

ES6 Spread
Use of the spread operator ... to call variadic functions. It's cleaner, avoids the supply of a context and also prevents the compose of new with apply.

ESLint: prefer-spread

Examples
⇣ Incorrect code for this rule:
const winter = ["snow", "frost"];
console.log.apply(console, winter);

new (Function.prototype.bind.apply(Date, [null, 2018, 1, 20]));

⇡ Correct code for this rule:
const winter = ["snow", "frost"];
console.log(...winter);

new Date(...[2018, 1, 20]);

Signature Invocation Indentation
Functions with multiline signatures, or invocations, should be indented like every other multiline list. Each item on a line by itself.
Examples
⇣ Incorrect code for this rule:
function winter(snow,
               frost,
               ice) {
  // ...
}

console.log(snow,
  frost,
  ice);

⇡ Correct code for this rule:
function winter(
  snow,
  frost,
  ice
) {
  // ...
}

console.log(
  snow,
  frost,
  ice
);

rules/arrow_functions.html.body:
Anonymous Functions
Use arrow function notation for anonymous functions e.g. when passing an inline callback. It creates a version of the function that executes in the context of this which is usually the desired functionality, and is a more concise syntax.
When dealing with a fairly complicated function, it is recommended to move that logic out into its own named function expression.

ESLint: prefer-arrow-callback and arrow-spacing

Examples
⇣ Incorrect code for this rule:
[1, 2, 3].map(function (number) {
  const nextNumber = number + 1;
  return number * nextNumber;
});

⇡ Correct code for this rule:
[1, 2, 3].map(number => {
  const nextNumber = number + 1;
  return number * nextNumber;
});

Implicit Return
If the function body consists of a single statement returning an expression without side effects, omit the braces and use the implicit return. Otherwise use a return statement. This rule is syntactic sugar and significantly increases the readability when multiple functions are chained together.

ESLint: arrow-parens and arrow-body-style

Examples
⇣ Incorrect code for this rule:
["snow", "frost"].map(element => {
  const nextElement = element;
  `The winter season has ${nextElement}.`;
});

let isFalling = false;

snow(() => isFalling = true);

⇡ Correct code for this rule:
["snow", "frost"].map(element => `The winter season has ${element}.`);

["snow", "frost"].map(element => {
  const sparklingElement = `sparkling ${element}`;
  return `The winter season has ${sparklingElement}.`;
});

["snow", "frost"].map((element, index) => ({
  [index]: element
}));

// No implicit return with side effects.
function seasons(callback) {
  const season = callback();
  if (season === "snow") {
    // ...
  }
}

let isFalling = false;

snow(() => {
  isFalling = true;
});

Parentheses Wrap
In case the expression spans over multiple lines, wrap it in parentheses for better readability. This shows clearly where the function starts and ends.
Examples
⇣ Incorrect code for this rule:
["snow", "frost", "ice"].map(element => Object.prototype.hasOwnProperty.call(
    elementObjectWithAVeryLongName,
    element
  )
);

⇡ Correct code for this rule:
["snow", "frost", "ice"].map(element => (
  Object.prototype.hasOwnProperty.call(
    elementObjectWithAVeryLongName,
    element
  )
));

Single Argument Parentheses
If a function takes a single argument and doesn't use braces, omit the parentheses. Otherwise, always include parentheses around arguments for clarity and consistency.

ESLint: arrow-parens

Examples
⇣ Incorrect code for this rule:
["snow", "frost"].map((element) => `sparkling ${element}`);

["snow", "frost"].map((element) => {
  const sparkling = "sparkling";
  return `${sparkling} ${element}`;
});

⇡ Correct code for this rule:
["snow", "frost"].map(element => `sparkling ${element}`);

["snow", "frost"].map(element => (
  `A long string about the winter season with sparkling ${element}. It's so long that we don't want it to take up space on the ".map()" line!`
));

Comparison Operators Confusion
Avoid confusing arrow function syntax => with comparison operators (, >=).

ESLint: no-confusing-arrow

Examples
⇣ Incorrect code for this rule:
const elementDensity = element => element.density > 256 ? element.highDensity : element.lowDensity;

const elementDensity = (element) => element.density > 256 ? element.highDensity : element.lowDensity;

⇡ Correct code for this rule:
const elementDensity = element => (element.density > 256 ? element.highDensity : element.lowDensity);

const elementDensity = element => {
  const { density, highDensity, lowDensity } = element;
  return density > 256 ? highDensity : lowDensity;
};

rules/classes_and_constructors.html.body:
Prefer class
Always use class. Avoid manipulating prototype directly. The class syntax is more concise and easier to reason about.
Examples
⇣ Incorrect code for this rule:
function Winter(elements = []) {
  this.elementQueue = [...elements];
}

Winter.prototype.pop = function () {
  const element = this.elementQueue[0];
  this.elementQueue.splice(0, 1);
  return element;
};

⇡ Correct code for this rule:
class Winter {
  constructor(elements = []) {
    this.elementQueue = [...elements];
  }
  pop() {
    const element = this.elementQueue[0];
    this.elementQueue.splice(0, 1);
    return element;
  }
}

Inheritance
Use extends for inheritance. It is a built-in way to inherit prototype functionality without breaking instanceof.
Examples
⇣ Incorrect code for this rule:
const inherits = require("inherits");
function SparklingWinter(elements) {
  Winter.apply(this, elements);
}
inherits(SparklingWinter, Winter);
SparklingWinter.prototype.sparkle = function () {
  return this.sparkles[0];
};

⇡ Correct code for this rule:
class SparklingWinter extends Winter {
  sparkle() {
    return this.sparkles[0];
  }
}

Chaining
Methods can return this to help with method chaining.
Examples
⇣ Incorrect code for this rule:
Snow.prototype.fall = function () {
  this.falling = true;
  return true;
};

Snow.prototype.setFlakeDensity = function (density) {
  this.flakeDensity = density;
};

const snow = new Snow();
snow.fall(); // true
snow.setFlakeDensity(20); // undefined

⇡ Correct code for this rule:
class Snow {
  fall() {
    this.falling = true;
    return this;
  }

  setFlakeDensity(density) {
    this.flakeDensity = density;
    return this;
  }
}

const snow = new Snow();

snow.fall()
  .setFlakeDensity(20);

Custom String Representation
When implementing a custom toString() function, make sure it works successfully and causes no side effects.
Examples
⇡ Correct code for this rule:
class Snow {
  constructor(conditions = {}) {
    this.flakeDensity = conditions.flakeDensity || 0;
  }

  getFlakeDensity() {
    return this.flakeDensity;
  }

  toString() {
    return `Flake Density: ${this.getFlakeDensity()}`;
  }
}

Unnecessary Default Constructor
Classes have a default constructor if one is not specified. An empty constructor function or one that just delegates to a parent class is unnecessary.

ESLint: no-useless-constructor

Examples
⇣ Incorrect code for this rule:
class Snow {
  constructor() {}

  getFlakeDensity() {
    return this.flakeDensity;
  }
}

class Snowball extends Snow {
  constructor(...args) {
    super(...args);
  }
}

⇡ Correct code for this rule:
class Snowball extends Snow {
  constructor(...args) {
    super(...args);
    this.radius = 4.2;
  }
}

No Duplicate Members
Avoid duplicate class members. Duplicate class member declarations will silently prefer the last one - having duplicates is almost certainly a bug.

ESLint: no-dupe-class-members

Examples
⇣ Incorrect code for this rule:
class Snow {
  fall() { return true; }
  fall() { return false; }
}

⇡ Correct code for this rule:
class Snow {
  fall() { return true; }
}

class Snow {
  fall() { return false; }
}

rules/modules.html.body:
Use import and export
Always use modules (import/export) over a non-standard module system because modules will become the standard. If necessary it is always possible to transpile to another module system afterwards.
Examples
⇣ Incorrect code for this rule:
const Winter = require("./Winter");
module.exports = Winter.snow;

⇡ Correct code for this rule:
import Winter from "./Winter";
export default Winter.snow;

⇢ Recommended code for this rule:
import { snow } from "./Winter";
export default snow;

No Wildcard Import
Do not use wildcard imports. This makes sure to have a single default export.
Examples
⇣ Incorrect code for this rule:
import * as Winter from "./Winter";

⇡ Correct code for this rule:
import Winter from "./Winter";

No Export From Import
Do not export directly from an import. Although the one-liner is concise, this ensures consistency by having one clear way to import and one clear way to export.
Examples
⇣ Incorrect code for this rule:
// filename snow.js
export { snow as default } from "./Winter";

⇡ Correct code for this rule:
// filename snow.js
import { snow } from "./Winter";
export default snow;

No Duplicate Imports
Only import from a path in one place. The code maintainability is more difficult when having multiple lines that import from the same path.

ESlint: no-duplicate-imports

Examples
⇣ Incorrect code for this rule:
import winter from "winter";
// ... other imports
import { snow, frost } from  "winter";

⇡ Correct code for this rule:
import winter, { snow, frost } from "winter";

import winter, {
  snow,
  frost
} from "winter";

No Mutable Exports
Do not export mutable bindings. Mutation should be avoided in general, but in particular when exporting mutable bindings. While this technique may be needed for some special cases, in general, only constant references should be exported.

ESLint: import/no-mutable-exports

Examples
⇣ Incorrect code for this rule:
let season = "winter";
export { season };

⇡ Correct code for this rule:
const season = "winter";
export { season };

Prefer Default Export
Prefer default export over named export for modules with a single export to increase the code readability and maintainability.

ESLint: import/prefer-default-export

Examples
⇣ Incorrect code for this rule:
export function snow() {}

⇡ Correct code for this rule:
export default function snow() {}

Imports First
Put all import above non-import statements. Since import statements are hoisted, keeping them all at the top prevents surprising behavior.

ESLint: import/first

Examples
⇣ Incorrect code for this rule:
import snow from "snow";
snow.fall();

import frost from "frost";

⇡ Correct code for this rule:
import snow from "snow";
import frost from "frost";

snow.fall();

Multiline Import Indentation
Multiline imports should be indented like multiline array and object literals. The curly braces follow the same indentation rules as every other curly brace block in the style guide.
Examples
⇣ Incorrect code for this rule:
import {snow, frost, ice, storm, sparkle} from "winter";

⇡ Correct code for this rule:
import {
  snow,
  frost,
  ice,
  storm,
  sparkle
} from "winter";

Avoid Webpack Loader Syntax
Disallow Webpack loader syntax in module import statements. Using Webpack syntax in the imports couples the code to a module bundler. Prefer using the loader syntax in the Webpack configuration webpack.config.js.

ESlint: import/no-webpack-loader-syntax

Examples
⇣ Incorrect code for this rule:
import snow from "css!sass!snow.scss";
import frost from "style!css!frost.css";

⇡ Correct code for this rule:
import snow from "snow.scss";
import frost from "frost.css";

rules/iterators_and_generators.html.body:
No Iterators
Don't use iterators. Prefer JavaScript's higher-order functions instead of loops like for-in or for-of. Dealing with pure functions that return values is easier to reason about than side effects and enforces the immutable rule of this style guide.
Use

map()
every()
filter()
find()
findIndex()
reduce()
some()
...

to iterate over arrays, and

Object.keys()
Object.values()
Object.entries()

to produce arrays to iterate over objects.

ESLint: no-iterator and no-restricted-syntax

Examples
⇣ Incorrect code for this rule:
const snowflakes = [1, 2, 3, 4, 5];

let flakes = 0;
for (let flake of snowflakes) {
  flakes += flake;
}
flakes === 15;

const snowflakes = [1, 2, 3, 4, 5];

const increasedByOne = [];
for (let i = 0; i 
⇡ Correct code for this rule:
const snowflakes = [1, 2, 3, 4, 5];

let flakes = 0;
snowflakes.forEach(flake => {
  flakes += flake;
});
flakes === 15;

const snowflakes = [1, 2, 3, 4, 5];

const increasedByOne = [];
snowflakes.forEach(flake => {
  increasedByOne.push(flake + 1);
});

⇢ Recommended code for this rule:
const snowflakes = [1, 2, 3, 4, 5];

const flakes = snowflakes.reduce((total, flake) => total + flake, 0);
flakes === 15;

const snowflakes = [1, 2, 3, 4, 5];

const increasedByOne = snowflakes.map(flake => flake + 1);

No Generators
Don't use generators for now since they don't transpile well to ES5.
Spacing
If the usage of generators is necessary, or disregard the rule to not use generators, make sure their function signature is spaced properly. The function and * syntax are part of the same conceptual keyword - * is not a modifier for function, function* is a unique construct, different from function.
Examples
↯ Critical incorrect code for this rule:
function
*
snow() {
  // ...
}

const snow = function
*
() {
  // ...
};

⇣ Incorrect code for this rule:
function * snow() {}

const snow = function * () {}

const snow = function *() {}

const snow = function*() {}

function*snow() {}

function *snow() {}

⇡ Correct code for this rule:
function* snow() {}

const snow = function* () {}

rules/properties.html.body:
Dot Notation
Use dot notation when accessing properties.

ESLint: dot-notation

Examples
⇣ Incorrect code for this rule:
const snowball = {
  density: 20,
  falling: true
};

const isFalling = snowball["falling"];

⇡ Correct code for this rule:
const snowball = {
  density: 20,
  falling: true
};

const isFalling = snowball.falling;

Bracket Notation
Use bracket notation [] when accessing properties with a variable.
Examples
⇣ Incorrect code for this rule:
const snowball = {
  density: 20,
  falling: true
};

function getProp(prop) {
  return snowball[prop];
}

const isFalling = getProp("falling");

Exponentiation Operator
Use exponentiation operator ** when calculating exponentiations.

ESLint: no-restricted-properties

Examples
⇣ Incorrect code for this rule:
const binary = Math.pow(2, 10);

⇡ Correct code for this rule:
const binary = 2 ** 10;

rules/variables.html.body:
Declaration
Always use const or let to declare variables to avoid polluting the global namespace, otherwise this will result in global variables.

ESLint: no-undef and prefer-const

Examples
⇣ Incorrect code for this rule:
snow = new Snow();

⇡ Correct code for this rule:
const snow = new Snow();

Declaration Separation
Use one const or let declaration per variable. It simplifies the addition of new variable declarations and increases the code readability and maintainability. This also allows to step through each declaration with the debugger, instead of jumping through all of them at once.

ESLint: one-var

Examples
⇣ Incorrect code for this rule:
const snowflakes = getSnowflakes(),
    frost = true,
    season = "winter";

⇡ Correct code for this rule:
const snowflakes = getSnowflakes();
const frost = true;
const season = "winter";

Grouping
Group all const and then group all let declarations. This helps to assign a variable depending on one of the previous assigned variables.
Examples
⇣ Incorrect code for this rule:
let snow, frost, ice,
    snowflakes = getSnowflakes(),
    isWinter = true;

let snow;
const snowflakes = getSnowflakes();
let frost;
const isWinter = true;
let ice;

⇡ Correct code for this rule:
const isWinter = true;
const snowflakes = getSnowflakes();
let snow;
let frost;
let ice;

Assignment
Assign variables when they are needed, but place them in a reasonable place. let and const are block scoped and not function scoped.
Examples
⇣ Incorrect code for this rule:
// Unnecessary function call.
function checkWinterSeason(season) {
  const name = getName();

  if (season === "summer") {
    return false;
  }

  if (name === "winter") {
    this.setName("");
    return false;
  }

  return name;
}

⇡ Correct code for this rule:
function checkWinterSeason(season) {
  if (season === "summer") {
    return false;
  }

  const name = getName();

  if (name === "winter") {
    this.setName("");
    return false;
  }

  return name;
}

No Chain Assignment
Don't chain variable assignments. Chaining variable assignments creates implicit global variables.

ESLint: no-multi-assign

Examples
⇣ Incorrect code for this rule:
(function winter() {
  /*
   * JavaScript interprets this as
   *
   * let snow = ( frost = ( ice = 1 ) );
   *
   * The "let" keyword only applies to variable "snow".
   * The variables "frost" and ice become global variables.
   *
   * The same applies for the "const" syntax.
   */
  let snow = frost = ice = 1;
}());

console.log(snow); // ReferenceError
console.log(frost); // 1
console.log(ice); // 1

⇡ Correct code for this rule:
(function winter() {
  let snow = 1;
  let frost = snow;
  let ice = snow;
}());

console.log(snow); // ReferenceError
console.log(frost); // ReferenceError
console.log(ice); // ReferenceError

No Unary Increment and Decrement
Avoid using unary increments and decrements (++, --). Per ESLint documentation, unary increment and decrement statements are subject to automatic semicolon insertion and can cause silent errors with incrementing or decrementing values within an application. It is also more expressive to mutate values with statements like number += 1 instead of number++ or number ++. Disallowing unary increment and decrement statements also prevents pre-incrementing/pre-decrementing values unintentionally which can also cause unexpected behavior.
Exceptions are final expression in for loops which can be configured for ESLint by enabling the allowForLoopAfterthoughts option.

ESLint: no-plusplus

Examples
⇣ Incorrect code for this rule:
const snowflakes = [1, 2, 3];
let flake = 1;
flake++;
--flake;

let total = 0;
let allFlakes = 0;
for (let i = 0; i 
⇡ Correct code for this rule:
const snowflakes = [1, 2, 3];
let flake = 1;
flake += 1;
flake -= 1;

const total = snowflakes.reduce((a, b) => a + b, 0);
const allFlakes = snowflakes.filter(Boolean).length;

rules/hoisting.html.body:
Overview
var declarations get hoisted to the top of their closest enclosing function scope, their assignment does not. const and let declarations are blessed with a new concept called Temporal Dead Zones (TDZ). It is important to know why typeof is no longer safe.
References

JavaScript Scoping & Hoisting by Ben Cherry

Examples
Assuming there is no notDefined global variable, this won't work.
function snow() {
  console.log(notDefined); // throws a ReferenceError
}

Creating a variable declaration after referencing it will work due to variable hoisting. Note that the assignment value of true is not hoisted!
function snow() {
  console.log(declaredButNotAssigned); // undefined
  var declaredButNotAssigned = true;
}

The interpreter is hoisting the variable declaration to the top of the scope, which means that the example above could be rewritten as:
function snow() {
  let declaredButNotAssigned;
  console.log(declaredButNotAssigned); // undefined
  declaredButNotAssigned = true;
}

Using const and let:
function snow() {
  console.log(declaredButNotAssigned); // throws a ReferenceError
  console.log(typeof declaredButNotAssigned); // throws a ReferenceError
  const declaredButNotAssigned = true;
}

Anonymous Function Expressions
Anonymous function expressions hoist their variable name, but not the function assignment.
Examples
function snow() {
  console.log(anonymous); // undefined

  anonymous(); // TypeError: anonymous is not a function

  var anonymous = function () {
    console.log("anonymous function expression");
  };
}

Named Function Expressions
Named function expressions hoist the variable name, not the function name or the function body.
Examples
function snow() {
  console.log(named); // undefined

  named(); // TypeError: named is not a function

  fall(); // ReferenceError: fall is not defined

  var named = function fall() {
    console.log("Falling");
  };
}

The same also applies when the function name is the same as the variable name.
function snow() {
  console.log(named); // undefined

  named(); // TypeError: named is not a function

  var named = function named() {
    console.log("named");
  };
}

Function Declaration
Function declarations hoist their name and the function body.
Examples
function snow() {
  fall(); // Falling

  function fall() {
    console.log("Falling");
  }
}

rules/comparison_operators_and_equality..body:
Equality Syntax
Use === and !== instead of == and !=.

ESLint: eqeqeq

References

Truth, Equality and JavaScript by Angus Croll

Examples
⇣ Incorrect code for this rule:
const season = "winter";

console.log(season == "winter");
console.log(season != "winter");

⇡ Correct code for this rule:
const season = "winter";

console.log(season === "winter");
console.log(season !== "winter");

Conditional Statements
Conditional statements such as the if statement evaluate their expression using coercion with the ToBoolean abstract function and always follows these rules:

Objects evaluate to true
Undefined evaluates to false
Null evaluates to false
Booleans evaluate to the value of the boolean
Numbers evaluate to false if +0, -0, or NaN, otherwise true
Strings evaluate to false if an empty string "", otherwise true

Examples
An array (even an empty one) is an object and Objects will evaluate to true.
if ([0] && []) {
  // ...
}

Shortcuts
Use shortcuts for booleans, but explicit comparisons for strings and numbers.
Examples
⇣ Incorrect code for this rule:
if (isSnowing === true) {
  // ...
}

if (snow) {
  // ...
}

if (snowflakes.length) {
  // ...
}

⇡ Correct code for this rule:
if (isSnowing) {
  // ...
}

if (snow !== "") {
  // ...
}

if (snowflakes.length > 0) {
  // ...
}

Switch Blocks
Use braces to create blocks in case and default clauses that contain lexical declarations like e.g. let, const, function, and class. Lexical declarations are visible in the entire switch block but only get initialized when assigned, which only happens when its case is reached. This causes problems when multiple case clauses attempt to define the same thing.

ESLint: no-case-declarations

Examples
⇣ Incorrect code for this rule:
switch (winter) {
  case "ice":
    let ice = true;
    break;
  case "frost":
    const frost = true;
    break;
  case "snow":
    function snow() {
      // ...
    }
    break;
  default:
    class Winter {}
}

⇡ Correct code for this rule:
switch (winter) {
  case "ice": {
    let ice = true;
    break;
  }
  case "frost": {
    const frost = true;
    break;
  }
  case "snow": {
    function snow() {
      // ...
    }
    break;
  }
  case "wind":
    wind();
    break;
  default: {
    class Winter {}
  }
}

Nested Ternaries
Ternaries should not be nested and generally be single line expressions.

ESLint: no-nested-ternary

Examples
⇣ Incorrect code for this rule:
const winter = snow > frost
  ? "snow"
  : ice > frost ? "ice" : null;

⇡ Correct code for this rule:
// Split into two separated ternary expressions.
const maybeIce = ice > frost ? "ice" : null;

const winter = snow > frost
  ? "snow"
  : maybeIce;

⇢ Recommended code for this rule:
const maybeIce = ice > frost ? "ice" : null;

const winter = snow > frost ? "snow" : maybeIce;

Avoid Unneeded Ternary
Avoid unneeded ternary statements.

ESLint: no-unneeded-ternary

Examples
⇣ Incorrect code for this rule:
const season = winter ? winter : summer;
const ice = negativeTemperature ? true : false;
const snow = negativeTemperature ? false : true;

⇡ Correct code for this rule:
const season = winter || summer;
const ice = !!negativeTemperature;
const snow = !negativeTemperature;

No Mixed Operators
When mixing operators, enclose them in parentheses. The only exception is the standard arithmetic operators (+, -, *, /) since their precedence is broadly understood. This improves readability and clarifies the developer's intention.

ESLint: no-mixed-operators

Examples
⇣ Incorrect code for this rule:
const season = winter && frost  0 || ice + 1 === 0;

const season = winter ** frost - 5 % ice;

// Could be confused with: (a || b) && c
if (winter || frost && snow) {
  return ice;
}

⇡ Correct code for this rule:
const season = (winter && frost  0 || (ice + 1 === 0);

const season = (winter ** frost) - (5 % ice);

if (winter || (frost && snow)) {
  return ice;
}

const season = winter + frost / snow * ice;

rules/blocks.html.body:
Braces
Use braces with all multi-line blocks.

ESLint: nonblock-statement-body-position

Examples
⇣ Incorrect code for this rule:
if (snow)
  return false;

function snow() { return false; }

⇡ Correct code for this rule:
if (snow) return false;

if (snow) {
  return false;
}

function snow() {
  return false;
}

Brace Style
When using multi-line blocks with if and else, put the else on the same line as the if block's closing brace.

ESLint: brace-style

Examples
⇣ Incorrect code for this rule:
if (winter) {
  snow();
  frost();
}
else {
  sunshine();
}

⇡ Correct code for this rule:
if (winter) {
  snow();
  frost();
} else {
  sunshine();
}

No else Return
If an if block always executes a return statement, the subsequent else block is unnecessary. A return in an else if block following an if block that contains a return can be separated into multiple if blocks.

ESLint: no-else-return

Examples
⇣ Incorrect code for this rule:
function winter() {
  if (snow) {
    return snow;
  } else {
    return frost;
  }
}

function winter() {
  if (snow) {
    return snow;
  } else if (frost) {
    return frost;
  }
}

function winter() {
  if (snow) {
    return snow;
  } else {
    if (frost) {
      return frost;
    }
  }
}

⇡ Correct code for this rule:
function winter() {
  if (snow) {
    return snow;
  }

  return frost;
}

function winter() {
  if (snow) {
    return snow;
  }

  if (frost) {
    return frost;
  }
}

function winter(snow) {
  if (snow) {
    if (ice) {
      return frost;
    }
  } else {
    return ice;
  }
}

rules/control_statements.html.body:
Indentation
When control statements (if, while etc.) are too long or exceed the maximum line length, each (grouped) condition could be put into a new line. The logical operator should begin the line. Requiring operators at the beginning of the line keeps the operators aligned and follows a pattern similar to method chaining. This also improves readability by making it easier to visually follow complex logic.
Examples
⇣ Incorrect code for this rule:
if ((season === "winter" || snowflakes === 20) && aVeryLongMethodNameThatExceedsTheLineLength() && anotherLongNamedMethod()) {
  snow();
}

if (snowflakes === 20 &&
  season === "winter") {
  snow();
}

if (snowflakes === 20
  && season === "winter") {
  snow();
}

if (
  snowflakes === 20 &&
  season === "winter"
) {
  snow();
}

⇡ Correct code for this rule:
if (
  snowflakes === 20
  && season === "winter"
) {
  snow();
}

if (
  (snowflakes === 20 || season === "winter")
  && aVeryLongMethodNameThatExceedsTheLineLength()
  && anotherLongNamedMethod()
) {
  snow();
}

if (snowflakes === 20 && season === "winter") {
  snow();
}

rules/comments.html.body:
Multi Line
Use /** ... */ for multi-line comments.
Examples
⇣ Incorrect code for this rule:
// Returns a new element based on the passed season name.
//
// @param {String} season
// @return {Element} element
function getElement(season) {
  // ...
  return element;
}

⇡ Correct code for this rule:
/**
 * Returns a new element based on the passed season name.
 *
 * @param {String} season - the name of the season
 * @return {Element} the element
 */
function getElement(season) {
  // ...
  return element;
}

Single Line
Use // for single line comments. Place single line comments on a newline above the subject of the comment. Put an empty line before the comment unless it's on the first line of a block.
Examples
⇣ Incorrect code for this rule:
const isSnowing = true;  // the current snow state.

function getWinterElement() {
  console.log("Loading winter elements...");
  // set the default type to "frost".
  const element = this.snow || 'frost';

  return element;
}

⇡ Correct code for this rule:
// the current snow state.
const isSnowing = true;

function getWinterElement() {
  console.log("Loading winter elements...");

  // set the default type to "frost".
  const element = this.snow || 'frost';

  return element;
}

function getWinterElement() {
  // set the default type to "frost".
  const element = this.snow || 'frost';

  return element;
}

Spacing
Start all comments with a space to make it easier to read.

ESLint: spaced-comment

Examples
⇣ Incorrect code for this rule:
//the current snow state.
const isSnowing = true;

/**
 *Returns a new element based on the passed season name.
 *
 *@param {String} season - the name of the season
 *@return {Element} the element
 */
function getElement(season) {
  // ...
  return element;
}

⇡ Correct code for this rule:
// the current snow state.
const isSnowing = true;

/**
 * Returns a new element based on the passed season name.
 *
 * @param {String} season - the name of the season
 * @return {Element} the element
 */
function getElement(season) {
  // ...
  return element;
}

rules/whitespace.html.body:
Indentation Character
Always use spaces characters where two (2) spaces are used for indentation. The usage of tab characters is disallowed. A tab could be a different number of columns depending on the environment, but a space is always one column. Adhering to this rule increases the code readability and maintainability significantly.

ESLint: indent

Examples
⇣ Incorrect code for this rule:
function winter() {
    let snow;
}

function winter() {
    let snow;
}

function winter() {
 let snow;
}

⇡ Correct code for this rule:
function winter() {
  let snow;
}

Before Blocks
Place one (1) space before the leading brace.

ESLint: space-before-blocks

Examples
⇣ Incorrect code for this rule:
function snow(){
  console.log("snow");
}

winter.set("snow",{
  density: 20,
  frozen: false
});

⇡ Correct code for this rule:
function snow() {
  console.log("snow");
}

winter.set("snow", {
  density: 20,
  frozen: false
});

Around Keywords
Place one (1) space before the opening parenthesis in control statements (if, while etc.). Place no space between the argument list and the function name in function calls and declarations.

ESLint: keyword-spacing

Examples
⇣ Incorrect code for this rule:
if(isWinter) {
  snow ();
}

function snow () {
  console.log ("falling");
}

⇡ Correct code for this rule:
if (isWinter) {
  snow();
}

function snow() {
  console.log("falling");
}

Infix Operator Spacing
Set off operators with spaces.

ESLint: space-infix-ops

Examples
⇣ Incorrect code for this rule:
const snowflakes=snow+5;

⇡ Correct code for this rule:
const snowflakes = snow + 5;

Newline
End files with a single newline character. Prefer the LF control character (*nix based OS) and avoid the usage of CRLF characters (mostly Microsoft Windows based OS).

ESlint: eol-last

Examples
⇣ Incorrect code for this rule:
import { snow } from "./Winter";
export default snow;

import { snow } from "./Winter";
export default snow;¬
¬

⇡ Correct code for this rule:
import { snow } from "./Winter";
export default snow;¬

Chains
Use indentation when making long method chains. Use a leading dot, which emphasizes that the line is a method call, not a new statement.

ESLint: newline-per-chained-call and no-whitespace-before-property

Examples
⇣ Incorrect code for this rule:
const elements = ["snow", "frost", "ice"];
elements.map(element => `sparkling ${element}`).find("snow").highlight().tokenize(2).end().updateCount();

const elements = ["snow", "frost", "ice"];
elements.map(element => `sparkling ${element}`).
  find("snow").
    highlight().
    tokenize(2).
  end().
    updateCount();

const elements = ["snow", "frost", "ice"];
elements.map(element => `sparkling ${element}`).find("snow").highlight().tokenize(2).find("frost")
    tokenize(3).highlight(false).find("ice").tokenize(1)
    .find("wind").highlight().tokenize().updateCount()
    .toString();

⇡ Correct code for this rule:
const elements = ["snow", "frost", "ice"];
elements.map(element => `sparkling ${element}`)
  .find("snow")
    .highlight()
    .tokenize(2)
  .end()
    .updateCount();

const elements = ["snow", "frost", "ice"];
elements.map(element => `sparkling ${element}`).tokenize(2).updateCount();

After Blocks
Leave a blank line after blocks and before the next statement.
Examples
⇣ Incorrect code for this rule:
if (winter) {
  return snow;
}
return frost;

const winter = {
  snow() {},
  frost() {}
};
return winter;

const winter = [
  function snow() {},
  function frost() {}
];
return winter;

⇡ Correct code for this rule:
if (winter) {
  return snow;
}

return frost;

const winter = {
  snow() {},

  frost() {}
};

return winter;

const winter = [
  function snow() {},

  function frost() {}
];

return winter;

Padded Blocks
Do not pad blocks with blank lines.

ESLint: padded-blocks

Examples
⇣ Incorrect code for this rule:
function winter() {

  console.log(snow);

}

if (winter) {

  console.log(snow);
} else {
  console.log(frost);

}

class Winter {

  constructor(snow) {
    this.snow = snow;
  }
}

⇡ Correct code for this rule:
function winter() {
  console.log(snow);
}

if (winter) {
  console.log(snow);
} else {
  console.log(frost);
}

class Winter {
  constructor(snow) {
    this.snow = snow;
  }
}

Inside Parentheses
Do not add spaces inside parentheses.

ESLint: space-in-parens

Examples
⇣ Incorrect code for this rule:
function winter( element ) {
  return element;
}

if ( winter ) {
  console.log(snow);
}

⇡ Correct code for this rule:
function winter(element) {
  return element;
}

if (winter) {
  console.log(snow);
}

Inside Brackets
Do not add spaces inside brackets.

ESLint: array-bracket-spacing

Examples
⇣ Incorrect code for this rule:
const winter = [ "snow", "frost", "ice" ];
console.log(winter[ 0 ]);

⇡ Correct code for this rule:
const winter = ["snow", "frost", "ice"];
console.log(winter[0]);

Inside Braces
Add spaces inside curly braces.

ESlint: object-curly-spacing

Examples
⇣ Incorrect code for this rule:
const season = {name: "winter"};

⇡ Correct code for this rule:
const season = { name: "winter" };

Maximum Line Length
Avoid having lines of code that are longer than 100 characters including whitespaces. Adhering to this rule increases the code readability and maintainability significantly.
Note that the rule for long strings is exempt from this rule, and should not be broken up.

ESLint: max-len

Examples
⇣ Incorrect code for this rule:
const season = winter && winter.elements && winter.elements.snow && winter.elements.snow.state && winter.elements.snow.state.temperature && winter.elements.snow.state.temperature.celsius;

season({ name: "winter", elements: ["snow", "frost"] }).load(() => console.log("Sparkling")).catch(() => console.log("Melting"));

⇡ Correct code for this rule:
const season = winter
  && winter.elements
  && winter.elements.snow
  && winter.elements.snow.state
  && winter.elements.snow.state.temperature
  && winter.elements.snow.state.temperature.celsius;

season({
  name: "winter",
  elements: ["snow", "frost"]
})
  .load(() => console.log("Sparkling"))
  .catch(() => console.log("Melting"));

rules/commas.html.body:
Leading and Trailing
Never use leading and trailing commas. It significantly decreases the code readability and is not compatible with the JSON notation.
Also note that trailing commas are illegal and will throw a SyntaxError when used function parameter definitions or function invocations only containing a comma. Furthermore, when using rest parameters (ES6 Rest Spread), trailing commas are not allowed:
function snow(,) {} // SyntaxError: missing formal parameter
(,) => {}; // SyntaxError: expected expression, got ','
snow(,) // SyntaxError: expected expression, got ','
function snow(...flakes,) {} // SyntaxError: parameter after rest parameter
(...flakes,) => {} // SyntaxError: expected closing parenthesis, got ','


ESLint: comma-style and comma-dangle

Examples
⇣ Incorrect code for this rule:
const winter = [
    snow
  , frost
  , ice
];

const winter = {
    name: "winter"
  , elements: ["snow", "frost", "ice"]
  , temperature: -12
  , state: "frozen"
};

const winter = [
  snow,
  frost,
  ice,
];

const winter = {
  name: "winter",
  elements: ["snow", "frost", "ice"],
  temperature: -12,
  state: "frozen",
};

⇡ Correct code for this rule:
const winter = [
  snow,
  frost,
  ice
];

const winter = {
  name: "winter",
  elements: ["snow", "frost", "ice"],
  temperature: -12,
  state: "frozen"
};

rules/semicolons.html.body:
Always use semicolons! When JavaScript encounters a line break without a semicolon, it uses a set of rules called Automatic Semicolon Insertion to determine whether or not it should regard that line break as the end of a statement, and (as the name implies) place a semicolon into the code before the line break. ASI contains a few eccentric behaviors which might break the code if JavaScript misinterprets a line break. These rules will become more complicated as new features become a part of JavaScript. Explicitly terminating statements and configuring linters to catch missing semicolons will help to prevent from encountering issues.
References

ECMAScript 2018 Specification
StackOverflow: "Semicolon before self-invoking function?"


ESLint: semi

Examples
⇣ Incorrect code for this rule:
const snow = {}
const frost = {}
[snow, frost].forEach(element => season.name = "winter") // ReferenceError: season is not defined

const winter = "Sparkling and frozen!"
(async function season(){
  // ...
}())

function winter() {
  return
    "The winter season is sparkling and frozen!"
}
// Returns "undefined" instead of the value on the next line.
// Always happens when "return" is on a line by itself because of ASI!
winter()

⇡ Correct code for this rule:
const snow = {};
const frost = {};
[snow, frost].forEach(element => {
  season.name = "winter";
});

const winter = "Sparkling and frozen!";
(async function season(){
  // ...
}());

function winter() {
  return "The winter season is sparkling and frozen!";
}

rules/type_casting_and_coercion.html.body:
Explicitness
Perform type coercion at the beginning of the statement.
No Primitive Wrapper Instances

ESlint: no-new-wrappers

Strings
Examples
⇣ Incorrect code for this rule:
this.snowflakes = 20;

// Type of "snowflakes" is "object" not "string".
const snow = new String(this.snowflakes);

this.snowflakes = 20;

// Invokes "this.reviewScore.valueOf()".
const snow = this.snowflakes + "";

this.snowflakes = 20;

// Not guaranteed to return a string.
const snow = this.snowflakes.toString();

⇡ Correct code for this rule:
this.snowflakes = 20;
const snow = String(this.snowflakes);

Numbers
Use Number for type casting and parseInt always with a radix for parsing strings.

ESLint: radix and no-new-wrappers

Examples
⇣ Incorrect code for this rule:
const snowflakes = "4";
const snow = new Number(snowflakes);

const snowflakes = "4";
const snow = +snowflakes;

const snowflakes = "4";
const snow = snowflakes >> 0;

const snowflakes = "4";
const snow = parseInt(snowflakes);

⇡ Correct code for this rule:
const snowflakes = "4";
const snow = Number(snowflakes);

const snowflakes = "4";
const snow = parseInt(snowflakes, 10);

Booleans

ESLint: no-new-wrappers

Examples
⇣ Incorrect code for this rule:
const snowflakes = 0;
const hasFlakes = new Boolean(snowflakes);

⇡ Correct code for this rule:
const snowflakes = 0;
const hasFlakes = Boolean(snowflakes);

⇢ Recommended code for this rule:
const snowflakes = 0;
const hasFlakes = !!snowflakes;

Bitshift
Be careful when using bitshift operations! Numbers are represented as 64-bit values, but bitshift operations always return a 32-bit integer. Bitshift can lead to unexpected behavior for integer values larger than 32 bits. The largest signed 32-bit integer is 2147483647 (2,147,483,647).
2147483647 >> 0; // 2147483647
2147483648 >> 0; // -2147483648
2147483649 >> 0; // -2147483647

When using Bitshift instead of parseInt for performance reasons, make sure to clarify and describe the design decision in the code documentation.
/**
 * This assignment has been performance optimized.
 * It uses bitshifting instead of casting via the "parseInt" method.
 * Bitshifting the String to coerce it to a Number resulted in a performance boost of almost 90%.
 */
const snow = snowflakes >> 0;

References

StackOverflow: "Bitshift in JavaScript"

rules/naming_conventions.html.body:
Descriptive
Avoid single letter names. Be descriptive with naming.

ESLint: id-length

Examples
⇣ Incorrect code for this rule:
function s() {
  // ...
}

⇡ Correct code for this rule:
function snow() {
  // ...
}

camelCase
Use camelCase when naming objects, functions, and instances.

ESLint: camelcase

Examples
⇣ Incorrect code for this rule:
const SNOwFlaakesssss = {};
const this_is_winter_season = {};
function s() {}

⇡ Correct code for this rule:
const snowflakes = {};
const thisIsWinterSeason = {};
function snow() {}

PascalCase
Use PascalCase when naming constructors and classes.

ESLint: new-cap

Examples
⇣ Incorrect code for this rule:
function snow(snowflakes) {
  this.density = snowflakes.density;
}

const snowball = new snow({
  density: 20
});

⇡ Correct code for this rule:
class Snow {
  constructor(snowflakes) {
    this.density = snowflakes.density;
  }
}

const snowball = new Snow({
  density: 20
});

Underscores
Do not use trailing or leading underscores. JavaScript does not have the concept of privacy in terms of properties or methods. Although a leading underscore is a common convention to mean private, in fact, these properties are fully public, and as such, are part of the public API contract. This convention might lead developers to wrongly think that a change won't count as breaking, or that tests aren't needed.

ESLint: no-underscore-dangle

Examples
⇣ Incorrect code for this rule:
this.__snow__ = "Snow";
this.frost_ = "Frost";
this._ice = "Ice";

⇡ Correct code for this rule:
this.snow = "Snow";
this.frost = "Frost";
this.ice = "Ice";

No this Self References
Don't save references to this. Use arrow functions or Function#bind.
Examples
⇣ Incorrect code for this rule:
function snow() {
  const self = this;
  return function () {
    console.log(self);
  };
}

⇡ Correct code for this rule:
function snow() {
  return () => {
    console.log(this);
  };
}

Filename Export Matching
A base filename should exactly match the name of its default export.
Examples
// frost.js
class Frost {
  // ...
}
export default Frost;

// SnowFalling.js
export default function snowFalling() { return "sparkling"; }

// Seasons.js
export default function winter() {}

// snow_flakes.js
class SnowFlakes {
  // ...
}
export default SnowFlakes;

⇣ Incorrect code for this rule:
// "PascalCase" import/export and "camelCase" filename.
import Frost from "./frost";

// "PascalCase" import/filename and "camelCase" export.
import SnowFalling from "./SnowFalling";

// "PascalCase" import/filename and "camelCase" export.
import Winter from "./Seasons";

// "PascalCase" import/export and "snake_case" filename.
import SnowFlakes from "./snow_flakes";

// Requiring the index file explicitly.
import seasons from "./seasons/index";
import index from "./seasons/index";

⇡ Correct code for this rule:
// "PascalCase" export/import/filename
import Frost from "./Frost";

// "camelCase" export/import/filename
import snowFalling from "./snowFalling";

// "camelCase" export/import/directory name/implicit "index".
// Supports both "seasons.js" and "seasons/index.js".
import seasons from "./seasons";

Function Default Export
Use camelCase when using export default for a function. The filename should be identical to your function's name.
Examples
⇣ Incorrect code for this rule:
// snow_falling.js
function snowFalling() {
  // ...
}

export default SnowFalling;

⇡ Correct code for this rule:
// snowFalling.js
function snowFalling() {
  // ...
}

export default snowFalling;

Singleton Export
Use PascalCase when exporting a constructor, class, singleton, function library or bare object.
Examples
⇣ Incorrect code for this rule:
// Winter.js
const Winter = {
  elements: ["snow", "frost"]
};

export default winter;

⇡ Correct code for this rule:
// Winter.js
const Winter = {
  elements: ["snow", "frost"]
};

export default Winter;

Acronyms And Initialisms
Acronyms and initialisms should always be all capitalized or all lowercased. Names are for readability, not to appease a computer algorithm.
Examples
⇣ Incorrect code for this rule:
import SmsContainer from "./containers/SmsContainer";

const HttpRequests = [
  // ...
];

⇡ Correct code for this rule:
import SMSContainer from "./containers/SMSContainer";

const HTTPRequests = [
  // ...
];

const httpRequests = [
  // ...
];

⇢ Recommended code for this rule:
import TextMessageContainer from "./containers/TextMessageContainer";

const requests = [
  // ...
];

rules/accessors.html.body:
Ignore Properties
Accessor functions for properties are not required.
Getter And Setter
Do not use JavaScript getters/setters as they cause unexpected side effects and are harder to test and maintain. Instead, if accessor functions are used, implement custom methods with get and set prefixes.
Examples
⇣ Incorrect code for this rule:
class Winter {
  get snowflakes() {
    // ...
  }

  set snowflakes(snowflakes) {
    // ...
  }
}

⇡ Correct code for this rule:
class Winter {
  getSnowflakes() {
    // ...
  }

  setSnowflakes(snowflakes) {
    // ...
  }
}

Make sure to be consistent:
class Winter {
  constructor(elements = {}) {
    const snowflakes = elements.snowflakes || 0;
    this.set("snowflakes", snowflakes);
  }

  set(key, val) {
    this[key] = val;
  }

  get(key) {
    return this[key];
  }
}

Boolean Prefix
If the property/method is a boolean, use a is or has prefix.
Examples
⇣ Incorrect code for this rule:
if (!winter.snowflakes()) {
  return false;
}

⇡ Correct code for this rule:
if (!winter.hasSnowflakes()) {
  return false;
}

rules/events.html.body:
Hash
When attaching data payloads to events (whether DOM events or something more proprietary like Backbone events), pass an object literal (also known as a hash) instead of a raw value. This allows a subsequent contributor to add more data to the event payload without finding and updating every handler for the event.
Examples
⇣ Incorrect code for this rule:
snow("snowflakesUpdated", snowfall.id);

on("snowflakesUpdated", (e, snowfallID) => {
  // Use "snowfallID".
});

⇡ Correct code for this rule:
snow("snowflakesUpdated", { snowfallID: snowfall.id });

on("snowflakesUpdated", (e, data) => {
  // Use "data.snowfallID".
});

rules/react/blocks.html.body:
Wrap Multiline JSX
Prevent missing parentheses around multiline JSX when they span more than one line. This prevents syntax errors and improves the readability and convenience.

ESLint:react/jsx-wrap-multilines

Examples
⇣ Incorrect code for this rule:
render() {
  return 

         ;
}

⇡ Correct code for this rule:
render() {
  return (



  );
}

Only omit parentheses for single line JSX:
render() {
  const snowFlakes = ;
  return {snowFlakes};
}

rules/react/classes_and_constructors.htm.body:
class And Stateless
Do not use React.createElement unless initializing the app from a file that is not JSX!
If the component has internal state and/or refs, use class extends React.Component. If no state or refs is used, prefer normal functions (not arrow functions) over classes.

ESLint: react/prefer-es6-class and react/prefer-stateless-function

Examples
⇣ Incorrect code for this rule:
const Snow = React.createClass({
  render() {
    return {this.state.snowflakes};
  }
});

No state or refs:
class Snow extends React.Component {
  render() {
    return {this.props.snowflakes};
  }
}

// Relying on function name inference is discouraged.
const Snow = ({ snowflakes }) => (
  {snowflakes}
);

⇡ Correct code for this rule:
class Snow extends React.Component {
  render() {
    return {this.state.snowflakes};
  }
}

No state or refs:
function Snow({ snowflakes }) {
  return {snowflakes};
}

rules/react/higher_order_components.html.body:
Display Name
Use a composite of the higher-order component's (HOC) name and the passed-in component's name as the displayName on the generated component. A component's displayName may be used by developer tools or in error messages, and having a value that clearly expresses this relationship helps to better understand and debug the code.
Examples
A higher-order component withSnow(), when passed a component Winter should produce a component with a displayName of withSnow(Winter).
⇣ Incorrect code for this rule:
import React, {Component} from "react";
import PropTypes from "prop-types";

export const withSnow = ComposedComponent => class WithSnow extends Component {
  constructor(props) {
    super();
  }

  static propTypes = {
    children: PropTypes.any
  };

  static defaultProps = {};

  render() {
    const {children, ...passThroughProps} = this.props;
    return (

        {children}

    );
  }
}

⇡ Correct code for this rule:
import React, {Component} from "react";
import PropTypes from "prop-types"

export const withSnow = ComposedComponent => class WithSnow extends Component {
  constructor(props) {
    super();
  }

  static displayName = `WithSnow(${ComposedComponent.displayName || ComposedComponent.name || Component.name})`;

  static propTypes = {
    children: PropTypes.any
  };

  static defaultProps = {};

  render() {
    const {children, ...passThroughProps} = this.props;
    return (

        {children}

    );
  }
}

rules/react/methods.html.body:
Prefer Arrow Functions Over bind
Arrow functions can be an attractive alternative to function expressions for callbacks or function arguments. They are automatically bound to their surrounding scope/context. This provides an alternative to the pre-ES6 standard of explicitly binding function expressions to achieve similar behavior.
Additionally, arrow functions are

less verbose, and easier to reason about which improves the readability of the code.
bound lexically regardless of where or when they are invoked.

Anyway, please note that there are some differences between arrow functions and binding:

Arrow functions are always anonymous, which means e.g. it is not possible to reliably call them recursively since there is no reliable lexical name to use.
Arrow functions actually create lexical bindings for this, super, and arguments. Only this is bound by .bind().
Arrow functions cannot be used in new expressions, while .bind() bound functions can.


ESLint: prefer-arrow-callback

Examples
⇣ Incorrect code for this rule:
XXX

⇡ Correct code for this rule:
XXX

References

Differences between bind() and fat arrow functions (GitHub issue comment)

No Binding Or Arrow Functions In Render
Do not use .bind() or arrow functions in render. A bind call or arrow function in a JSX prop will create a brand new function on every single render which is bad for performance, as it will result in the garbage collector being invoked way more than is necessary. It may also cause unnecessary re-renders if a brand new function is passed as a prop to a component that uses reference equality check on the prop to determine if it should update.

ESLint: react/jsx-no-bind

Examples
⇣ Incorrect code for this rule:
class Snow extends React.Component {
  onSnowflakeClick() {
    // ...
  }

  render() {
    return ;
  }
}

⇡ Correct code for this rule:
class Snow extends React.Component {
  constructor(props) {
    super(props);

    this.onSnowflakeClick = this.onSnowflakeClick.bind(this);
  }

  onSnowflakeClick() {
    // ...
  }

  render() {
    return ;
  }
}

⇢ Recommended code for this rule:
class Snow extends React.Component {
  onSnowflakeClick = () => {
    // ...
  }

  render() {
    return ;
  }
}

References

Why arrow functions and bind in React's Render are problematic
Arrow functions vs. bind()

No Underscore Prefix
Do not use underscore prefix for internal methods of a React component. Underscore prefixes are sometimes used as a convention in other languages to denote privacy. But, unlike those languages, there is no native support for privacy in JavaScript, everything is public. Regardless of the intentions, adding underscore prefixes to properties does not actually make them private, and any property (underscore-prefixed or not) should be treated as being public. See issues #1024, and #490 for a more in-depth discussion.
Examples
⇣ Incorrect code for this rule:
class Snow extends React.Component {
  _onFalling() {
    // ...
  }
}

⇡ Correct code for this rule:
class Snow extends React.Component {
  onFalling() {
    // ...
  }
}

Render Return
Be sure to return a value in the render function.

ESLint: react/require-render-return

Examples
⇣ Incorrect code for this rule:
render() {
  ();
}

⇡ Correct code for this rule:
render() {
  return ();
}

rules/react/naming_conventions.html.body:
One Component Per File
Only include one React component per file. However, multiple stateless functions or pure components are allowed per file.

ESLint: react/no-multi-comp

JSX File Extension
Always use .jsx file extension for files with JSX syntax.
File And Component Folder
The name of the file and the folder of components should exactly (case sensitive) match the name of the main (exported) component using PascalCase.

ESLint: react/jsx-pascal-case

Examples
⇣ Incorrect code for this rule:
// snow/Snow.jsx
export default class Snow extends React.Component {
  // ...
}

// Snow/snow.jsx
export default class Snow extends React.Component {
  // ...
}

// Snow/Frost.jsx
export default class Snow extends React.Component {
  // ...
}

⇡ Correct code for this rule:
// Snow/Snow.jsx
export default class Snow extends React.Component {
  // ...
}

References
Use PascalCase for components and camelCase for their instances.

ESLint: react/jsx-pascal-case

Examples
⇣ Incorrect code for this rule:
import snowFlake from "./SnowFlake";

const SnowFlake = ;

⇡ Correct code for this rule:
import SnowFlake from "./SnowFlake";

const snowFlake = ;

rules/react/ordering.html.body:
Component Methods And Properties
When creating React components it is more convenient to always follow the same organization for methods and properties order to easier find lifecycle methods, event handlers, static properties and render related elements:

Static methods and properties:
Lifecycle methods and properties:
2.1. displayName
2.2. propTypes
2.3. contextTypes
2.7. childContextTypes
2.5. statics
2.6. defaultProps
2.7. Optional static methods
2.8. constructor (classes)
2.9. getDefaultProps
2.10. getInitialState
2.11. state
2.12. getChildContext
2.13. componentWillMount
2.14. componentDidMount
2.15. componentWillReceiveProps
2.16. shouldComponentUpdate
2.17. componentWillUpdate
2.18. componentDidUpdate
2.19. componentWillUnmount
Custom methods:
3.1. Click and Event Handlers like e.g. onClickSubmit() or onChangeValue()
3.2. Getter and Setter methods for render like e.g. getSelectReason() or getFooterContent()
3.3. Any custom method like e.g. calculateSnowflakes()
3.4. Optional render methods like renderSnowflakes() or renderWinterForest()
render


ESLint: react/sort-comp

Examples
⇣ Incorrect code for this rule:
import React, { Component } from "react";
import PropTypes from "prop-types";

const propTypes = {
  density: PropTypes.number.isRequired,
  season: PropTypes.string
};

class Snow extends React.Component {
  constructor() {
    super();
    this.state = {
      // ...
    };
  }

  componentWillReceiveProps() {
    // ...
  }

  componentDidMount() {
    // ...
  }

  renderSnowflakes() {
    // ...
  }

  calculateDensity() {
    // ...
  }

  onChangeSeason() {
    // ...
  }

  static isFalling() {
    return true;
  }

  static defaultProps = {
    season: "Winter"
  }

  render() {
    return {this.props.season};
  }
}

Snow.propTypes = propTypes;

export default Snow;

⇡ Correct code for this rule:
import React, { Component } from "react";
import PropTypes from "prop-types";

export default class Snow extends React.Component {
  static propTypes = {
    density: PropTypes.number.isRequired,
    season: PropTypes.string
  };

  static defaultProps = {
    season: "Winter"
  };

  static isFalling() {
    return true;
  }

  constructor() {
    super();
    this.state = {
      // ...
    };
  }

  componentDidMount() {
    // ...
  }

  componentWillReceiveProps() {
    // ...
  }

  onChangeSeason = () => {
    // ...
  }

  calculateDensity = () => {
    // ...
  }

  renderSnowflakes = () => {
    // ...
  }

  render() {
