Explicit Default Props
Always define explicit defaultProps for all non-required props. propTypes are a form of documentation, and providing defaultProps means the reader of the code doesn't have to assume as much. In addition, it can mean that the code can omit certain type checks.
Examples
⇣ Incorrect code for this rule:
