  return {density}{season}{snowflakes};
}
Snow.propTypes = {
  density: PropTypes.number.isRequired,
  season: PropTypes.string,
  snowflakes: PropTypes.node
};

⇡ Correct code for this rule:
function Snow({ density, season, snowflakes }) {
  return {density}{season}{snowflakes};
}
Snow.propTypes = {
  density: PropTypes.number.isRequired,
  season: PropTypes.string,
  snowflakes: PropTypes.node
};
Snow.defaultProps = {
  season: "winter",
  snowflakes: null
};

